### Summary of Core Topics, Concepts, Principles, and Equations

#### Core Topics and Concepts

1. **Java Programming Basics**
   - **Classes and Objects**: Understanding how to define classes and create objects.
   - **Inheritance**: Extending classes and using the `super` keyword.
   - **Interfaces**: Implementing interfaces and using default methods.
   - **Generics**: Using generics to create flexible and reusable code.

2. **Collections Framework**
   - **Lists**: Using `ArrayList` and `LinkedList`.
   - **Sets**: Using `HashSet` and `TreeSet`.
   - **Maps**: Using `HashMap`, `TreeMap`, and `LinkedHashMap`.
   - **Iterators**: Iterating over collections using iterators.

3. **Exception Handling**
   - **Custom Exceptions**: Creating and throwing custom exceptions.
   - **Try-Catch Blocks**: Handling exceptions using try-catch blocks.

4. **Access Modifiers**
   - **Public, Private, Protected**: Understanding the scope and accessibility of methods and variables.

5. **Assertions**
   - **Assert Statements**: Using assertions to validate assumptions in the code.

6. **Streams API**
   - **Filtering and Mapping**: Using streams to filter and map data.
   - **Iterating**: Using streams to iterate over collections.

7. **Cloning**
   - **Shallow and Deep Copy**: Understanding the difference between shallow and deep copying of objects.

8. **Polymorphism**
   - **Method Overriding**: Overriding methods in subclasses.
   - **Interface Implementation**: Implementing interface methods in classes.

#### Important Principles

1. **Encapsulation**: Hiding the internal state and requiring all interaction to be performed through an object's methods.
2. **Inheritance**: Creating a new class that is a modified version of an existing class.
3. **Polymorphism**: The ability of an object to take on many forms.
4. **Abstraction**: Hiding the implementation details and showing only the functionality to the user.

#### Key Equations and Code Snippets

1. **Generics in Methods**
   ```java
   public static <T extends Laptop> void printPrice(List<T> lst) {
       for (int i = 0; i < lst.size(); i++) {
           System.out.println(lst.get(i).getPrice());
       }
   }
   ```

2. **Using Iterators**
   ```java
   Iterator<Book> it = bookList.iterator();
   while (it.hasNext()) {
       Book b = it.next();
       if (!isAvailable(b.availableCopies)) {
           it.remove();
       }
   }
   ```

3. **Exception Handling**
   ```java
   try {
       obj1.checkPermission();
       obj2.checkPermission();
   } catch (AccessDeniedException e) {
       System.out.println("Error: " + e.getMessage());
   }
   ```

4. **Streams API**
   ```java
   Stream<Integer> filteredNumbers = numbers.stream()
       .filter(n -> n % 2 == 0)
       .map(n -> n * 2);
   filteredNumbers.forEach(System.out::println);
   ```

5. **Cloning Objects**
   ```java
   public Project clone() throws CloneNotSupportedException {
       Project p = (Project) super.clone();
       p.task1 = p.task1.clone();
       p.task2 = p.task2.clone();
       return p;
   }
   ```

6. **Assertions**
   ```java
   assert salary > 0;
   assert investments > 0;
   ```

7. **Access Modifiers**
   ```java
   public void methodFour() {
       System.out.println("Display methodFour");
   }
   private void methodTwo() {
       System.out.println("Display methodTwo");
   }
   ```

8. **Polymorphism**
   ```java
   public void showPortable() {
       System.out.println("Laptop is portable");
   }
   ```

